import { Route, Routes } from 'react-router-dom';
import logo from './logo.svg';
import './App.css';
import CreatePoll from './components/Poll/CreatePoll';
import Poll from './components/Poll/Poll';

function App() {
  return (
    <div className="App">
      <CreatePoll />
      <Routes>
        <Route path='/poll/:id' element={<Poll />} />
      </Routes>
    </div>
  );
}

export default App;
